import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Header from './components/Header';
import BuyPage from './pages/BuyPage';

function Home() {
  return (
    <div className="home-layout">
      <Header />
      <div className="main-content" style={{ display: 'flex', flexDirection: 'row', justifyContent: 'space-between' }}>
        <div className="marketplace">
          <h3>MARKETPLACE</h3>
          <div className="button" style={{ backgroundImage: 'url(/path/to/buy-image.jpg)' }}>
            <Link to="/buy">BUY</Link>
          </div>
          <div className="button" style={{ backgroundImage: 'url(/path/to/sell-image.jpg)' }}>
            <Link to="/sell">SELL</Link>
          </div>
        </div>
        <div className="carpooling">
          <h3>CARPOOLING</h3>
          <div className="button" style={{ backgroundImage: 'url(/path/to/view-trips-image.jpg)' }}>
            <Link to="/view-trips">VIEW AVAILABLE TRIPS</Link>
          </div>
          <div className="button" style={{ backgroundImage: 'url(/path/to/add-trip-image.jpg)' }}>
            <Link to="/add-trip">ADD A TRIP</Link>
          </div>
        </div>
      </div>
      <div className="bottom">
        <div className="about">
          <h3>About</h3>
          <p>This platform allows IIT Dharwad students to buy and sell used items and coordinate carpooling efficiently.</p>
        </div>
      </div>
    </div>
  );
}

function Buy() {
  return <h2>Buy Page</h2>;
}

function Sell() {
  return <h2>Sell Page</h2>;
}

function Carpool() {
  return <h2>Carpool Page</h2>;
}

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Routes>
          <Route path="/buy" element={<BuyPage />} />
          <Route path="/sell" element={<Sell />} />
          <Route path="/carpool" element={<Carpool />} />
          <Route path="/" element={<Home />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
